webpackJsonp([0x854dc58195fb6000],{"./node_modules/json-loader/index.js!./.cache/json/mathematics-supplementary-angles.json":function(e,a){e.exports={data:{markdownRemark:{html:'<h2>Supplementary Angles</h2>\n<p>Two angles which sum up to 180° are called supplementary angles.</p>\n<p><img src="https://raw.githubusercontent.com/pranabendra/articles/master/Supplementary-angles/images/sup1.png" alt="Image showing two angles, one with 120 degrees and the other with 60 degrees"></p>\n<p>Supplementary angles don’t have to be next to each other, just so long as the total is 180°. Here’s an example:</p>\n<p><img src="https://raw.githubusercontent.com/pranabendra/articles/master/Supplementary-angles/images/sup2.png" alt="Parallel lines a and b with line t through them, creating 8 angles"></p>\n<p>As <code>a</code> is parallel to <code>b</code>, <b>angles</b> ”<code>3</code>” and ”<code>6</code>” sum up to 180°. Hence, they are supplementary angles.</p>\n<h3>More Information:</h3>\n<ul>\n<li>Supplementary Angles article: <a href=\'https://www.varsitytutors.com/hotmath/hotmath_help/topics/supplementary-angles\' target=\'_blank\' rel=\'nofollow\'>Varsity Tutors</a></li>\n</ul>',fields:{slug:"/mathematics/supplementary-angles/"},frontmatter:{title:"Supplementary Angles"}}},pathContext:{slug:"/mathematics/supplementary-angles/"}}}});
